import React, { Component } from 'react';
import { Pane, Heading, Button, Text, Badge } from 'evergreen-ui'
import '../styles/styles.scss'

class Index extends Component {

  render() {
    return (
      <div id="App">
      <Pane display="flex" height={150} alignItems="center" justifyContent="center">
        <Heading size={700}>COVID-19 "How To" Tracker</Heading>
      </Pane>
      <Pane display="flex" height={50} alignItems="center" justifyContent="center">
        <Heading size={500}>Common Guidelines</Heading>
      </Pane>
      <Pane display="flex" padding={16} background="tint2" borderRadius={3} flexDirection="column">
        <Heading size={600}>Sample Cluster Heading</Heading>
        <Text color="muted" marginTop="default">Summary information</Text>
        <Pane paddingTop={16}>
          <Badge color="neutral" marginRight={8}>Cleaning</Badge>
          <Badge color="green" marginRight={8}>Privacy</Badge>
          <Badge color="blue" marginRight={8}>Masks</Badge>
        </Pane>
      </Pane>
      </div>
    );
  }

}

export default Index;
